VALUES ('3608580940302', 'Andros So good & Veggie Pêche', 'Lait de coco allégé 58,6% (eau, extrait de noix de coco), eau, peche du Roussillon 11,8%, sucre, amidon modifié de tapioca, protéines de pois, phosphates de calcium, amidon, arôme naturel, jus concentré de citron, jus concentré de carotte, concentré de carotte, sel, épaississant: gomme guar, ferments. Présence possible de SOJA, FRUITS A COQUE GEFERMENTEERDE PLANTAARDIGE SPECIALITEIT MET KOKOSMELK EN PERZIKEN. Ingrediënten: Vetarme kokosmelk 58,6% (water, kokosnootextract), water, perziken uit de Roussillon 11,8%, suiker, gemodificeerd tapiocazetmeel, erwtenproteinen, calciumfosfaten, zetmeel, natuurlijk aroma, geconcentreerd citroensap, geconcentreerd wortelsap wortelconcentraat, zout, verdikkingsmiddel: guarpitmeel, fermenten. Kan sporen bevatten van SOJA en NOTEN **soit 15% des apports de référence pour un adulte-type (8400 kJ/', 'https://static.openfoodfacts.org/images/products/360/858/094/0302/front_fr.14.400.jpg', '2.9', '2.8', '16', '10', '', '0.4', '0.08', '0.031496062992126', '', '1');

